Hello fellow AK owners, My name is Mike. I have a Century Arms C39 Sporter AK-47 but the gun is NOT FOR SALE. The picture is solely there to show you the accessories. I'm looking to give it a new look, new mags, accessories, furniture ect. There is absolutely nothing wrong with any of these accessories or parts. All the mags feed perfect(You can test if you'd like). Nearly everything is in mint condition and works perfect. I just want to upgrade and give it a new look!!I will sell Items separately if I have too for the prices listed, firm. Possibly a slim chance at a trade if you have what I want any aftermarket AK parts I'll entertain. Show me what you got. I'm planning to purchase a full top rail, new optics, new window mags, full-size handguard w/ accessories, 2.5lb adj. trigger, AR style sling mounts, Tactical ambi safety, ambi finger mag release, gas tube rail, open sight style gas block sight combo, charging handle extensions...ect. ect.            All Items together in one purchase $275                    *ATTENTION! (Read below)***The stocks, handguard and a few other parts will only fit               AK varients with a Milled Receiver.** The price that is listed applies only if you were to        purchase all items listed in one transaction. The    individual prices that are listed below are if you'd    purchase items separately.                                 •Here is a list of what I have to sell;
-Strike Industries sight block railed optic mount(Minimal  use, minor niks from installation/removal, black) $30-Command Arms adjustable stock w/cheek riser (mininal  use, mint condition except for the cheek riser which  could be fixed or replaced for $20 it was an additional  upgrade from CAA, black, price new $120,  price is  excluding cheek riser but included) $70-Tapco G2 trigger set(used, 200 rounds fired, excellent condition) $20-Magpul pistol grip(mint condition, new $20, black) $15-CA Sporter pistol grip w/ finger grooves(almost no use, Mint condition, black) $10-Two 30 round 2nd gen Magpul P-Mags and one Tapco 30  round mag (Minimal use, mint condition, black) $30-One 40 round promag w/ smooth finish (Mint Condition, used only a few times, black) $20-Classic syle polymer fixed stock w/ sling loop (minimal  use, mint condition, black)$15-Short polymer quad railed handguard w/ rubber rail  covers (used for about 200 rounds, excellent condition, black) $25-Sig Sauer SigTac CP1 scope 3x zoom($150 new, little use,  great condition, minor scratches on the mounting bolt  heads from mount/removal of scope..other than that  she's good to go!) $85-AR15 style muzzle device(used, 200 rounds through, excellent condition) $10-CA Sport gas tube/Sight combo(used, 200 rounds  through while mounted, mint condition) $35-CA Tactical sport extended mag release(used, excellent  condition, black) $10 
 Send me an email or text if your interested or would like            further info or pictures, thanks for looking!              Text Mike at: (7One5)-8Six9-Five37Six
